package gvcsa_test

import (
	"4420project/gvcsa"
	"4420project/suffixArray"
	"4420project/suffixTree"
	"fmt"
	"github.com/DmitriyVTitov/size"
	"testing"
	"time"
)

func TestMakeGVCSArray(t *testing.T) {
	str := ""
	fmt.Println(str)
	array := suffixTree.NewSuffixTree(str).ToSuffixArray()
	sa := suffixArray.SuffixArray{Text: array.Text, POS: array.POS}
	fmi := sa.ToWTFMI()
	gvcsArray := gvcsa.MakeGVCSArray(sa)
	fmt.Println(size.Of(str))
	fmt.Println(size.Of(sa))
	fmt.Println(size.Of(gvcsArray))
	fmt.Println(size.Of(fmi))
	time1 := int64(0)
	time2 := int64(0)
	for i := 0; i < 50000; i++ {
		s := time.Now().UnixNano()
		sa.Search(str[0+i : 50+i])
		e := time.Now().UnixNano()
		time1 += e - s
		s = time.Now().UnixNano()
		fmi.Search(str[0+i : 50+i])
		e = time.Now().UnixNano()
		time2 += e - s
	}
	fmt.Println(time1)
	fmt.Println(time2)
}

func TestEncodeIntArray(t *testing.T) {
	arr := make([]int, 3)
	arr[0] = 1
	arr[1] = 2
	arr[2] = 10
	array := gvcsa.EncodeIntArray(arr)
	arr2 := gvcsa.DecodeIntArray(array)
	fmt.Println(arr2)
}
